import './style.css';

function Piece() {

   return (
      <div className="piece">
         <h1 className="piece-title">Porefect Skincare</h1>
         <img src="/assets/work/porefection/desktop-mockup.png" alt="Porefection mockup."></img>
         <div className="piece-details">
            <div className="piece-headline">
               <h1 id="piece-"></h1>
            </div>
         </div>
      </div>
   );

}

export default Piece;
